export default function getLineData(data) {
  let profileList = [];

  data['data'].forEach(profile => {
    profileList.push([
      {
        index: "Extension",
        data: (() => {
          try {
            let destruct = profile['data']['pattern'];
            return destruct ? destruct : "";
          }
          catch {return ""};
        })()
      },
      {
        index: "Alerting Name",
