            // }
            // return ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Location",
        data: (() => {
          try {
            let destruct = profile['callForwardAll']['forwardToVoiceMail']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      }
    ])
  })

  return new Promise((resolve, reject) => {
    resolve(profileList)
    reject("Unable to retireve devices.")
  })
}
